import { useContext } from "react";
import { dataContext } from "../components/context/DataContext";

import { Link } from "react-router-dom";

const imageStyle = {
  width: "240px",
  height: "240px",
};
const VideoProductions = () => {
  const { videosProductions } = useContext(dataContext);

  return videosProductions.map((videos) => {
    return (
      <div class='projects-section-container' key={videos.id}>
        <Link to={`/${videos.id}`}>
          <ul class='projects-list-container'>
            <li className='projects-list-item'>
              <img src={videos.img} />
              <div class='projects-list-item-info'>
                <h3>{videos.name} </h3>
                <h6>{videos.description}</h6>
              </div>
            </li>
          </ul>
        </Link>
      </div>
    );
  });
};

export default VideoProductions;
